"L'hai fatto per il Professor?"
 "...Il Professor  un brav'uomo. A volte i brav'uomini hanno bisogno di essere protetti. Anche da se stessi."

"Hai preso le lancette per impedire al Professor di distruggerle"
 "...Voi capite. S. Non potevo permettere che un momento di rabbia cancellasse l'opera di una vita. Le lancette sono al sicuro. Torneranno a mezzanotte. Il nuovo anno inizier."

